// SPDX-License-Identifier: MIt
pragma solidity >=0.4.22 <0.8.0;
import "./GLDToken.sol";

contract DepositorContrat {
    uint256 public totalSupply = 0;
    address private contractGldAddr;

    mapping(address => uint256) public claimers;

    constructor(address _contractGldAddr) public {
        contractGldAddr = _contractGldAddr;
    }

    function claimGldTokens() public {
        GLDToken(contractGldAddr).claimTokens();
        claimers[msg.sender] += 1000;
        totalSupply += 1000;
    }

    function withdrawGldTokens(uint256 amount) public {
        require(claimers[msg.sender] > 0, "You need to claim some tokens");
        require(amount <= claimers[msg.sender], "Not enough tokens");
        GLDToken(contractGldAddr).transfer(msg.sender, amount);
        claimers[msg.sender] -= amount;
        totalSupply -= amount;
    }

    function depositGldTokens(uint256 amount) public {
        require(amount > 0, "You need to deposit some tokens");
        GLDToken(contractGldAddr).transferFrom(
            msg.sender,
            address(this),
            amount
        );
        claimers[msg.sender] += amount;
        totalSupply += amount;
    }
}
